          mealtypes : [],
          restaurants : []
      }
  }
 
  componentDidMount = async() => {
  let location = await axios({
    method : 'GET',
    url : 'http://localhost:8900/locations',
 
});
this.setState({locations : location.data});
let mealtype = await axios({
  method : 'GET',
